import React from 'react';
import style from './Landing.module.css'

function Landing() {
    return (
        <section className={style.landing}>
            <div className={style.overlay}>
                <h1 className={style.mainheading}>Rassoie</h1>
            </div>
        </section>
    )
}

export default Landing
